import React from 'react'
import Todo from './Todo'

const TodosList = ({todos, setTodos, filteredTodos}) => {

    return (
        <div>
            {filteredTodos.map((todo) => (
                <Todo />
            )
            )}
        </div>
    )
}

export default TodosList;
